INSERT INTO `khut_stories` (`id`, `title`, `subject`, `details`, `is_active`, `image`, `created_at`, `updated_at`) VALUES
(10, 'Welcome to Khut v.4', 'Cotton Saree', '<table style=\"border-collapse: collapse; width: 82.898%; margin-left: auto; margin-right: auto;\" border=\"1\"><colgroup><col style=\"width: 33.3426%;\"><col style=\"width: 33.3426%;\"><col style=\"width: 33.3148%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td><img style=\"float: right;\" src=\"https://bd-admin.khut.shop/uploads/tinymce/1767787575_695e4c37cefc5.jpg\" alt=\"\" width=\"260\" height=\"390\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://bd-admin.khut.shop/uploads/tinymce/1767787603_695e4c53a1fde.jpg\" alt=\"\" width=\"260\" height=\"391\"></td>\r\n<td><img style=\"float: left;\" src=\"https://bd-admin.khut.shop/uploads/tinymce/1767787659_695e4c8ba195d.jpg\" alt=\"\" width=\"267\" height=\"401\"></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://bd-admin.khut.shop/uploads/tinymce/1767787559_695e4c27b172b.jpg\" alt=\"\" width=\"632\" height=\"421\"></p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>Cotton Saree &ndash; features intricate block prints, carefully stamped along with hand-stich ,bringing alive timeless motifs and patterns inspired by nature, culture, and folklore.</p>\r\n<p>Soft, breathable, and lightweight, this saree ensures comfort and effortless elegance. Its fine weave makes it ideal for daily wear or any special moment. A timeless choice for a graceful look.</p>\r\n<p>Cotton Saree &ndash; features intricate block prints, carefully stamped along with hand-stich ,bringing alive timeless motifs and patterns inspired by nature, culture, and folklore.</p>\r\n<p>Soft, breathable, and lightweight, this saree ensures comfort and effortless elegance. Its fine weave makes it ideal for daily wear or any special moment. A timeless choice for a graceful look.</p>\r\n<p>Cotton Saree &ndash; features intricate block prints, carefully stamped along with hand-stich ,bringing alive timeless motifs and patterns inspired by nature, culture, and folklore.</p>\r\n<p>Soft, breathable, and lightweight, this saree ensures comfort and effortless elegance. Its fine weave makes it ideal for daily wear or any special moment. A timeless choice for a graceful look.</p>\r\n<p>Cotton Saree &ndash; features intricate block prints, carefully stamped along with hand-stich ,bringing alive timeless motifs and patterns inspired by nature, culture, and folklore.</p>\r\n<p>Soft, breathable, and lightweight, this saree ensures comfort and effortless elegance. Its fine weave makes it ideal for daily wear or any special moment. A timeless choice for a graceful look.</p>', 'Y', '/uploads/1762096774.jpg', '2025-09-28 02:19:34', '2026-01-07 06:07:54');
