(402, 'patchwork-short-pant', 'Patchwork short pant', 'মাল্টি প্যাচওয়ার্ক শর্ট প্যান্ট লাল', '<p><span style=\"color: #ba372a;\">Pant, Patchwork</span></p>\r\n<p>Cotton short pocket pant with colorful patchwork detailing for a relaxed, artsy style.</p>\r\n<p>NOTE: Patchwork is a craft of needlework in which small pieces of cloth in different designs, patterns, colors, or textures are sewed together. Each and every patch work is different and unique. The designs may not be identically same.<br>-khut</p>', 'gallery/52OiQQYsYF6gFTm9DHTs4IO5bRGiAOmNLcASxI8B.jpg', 16, 25, NULL, 1260.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'Y', 'undefined', 'undefined', 'undefined', NULL, '1122162943588', NULL, NULL),
(404, 'side-patchwork-pant', 'Side patchwork pant', 'সাইড প্যাচওয়ার্ক প্যান্ট', '<p><span style=\"color: #ba372a;\">Pant, Patchwork</span></p>\r\n<p>Free-size cotton pant with subtle side patchwork pocket detailing for an easy, stylish fit.</p>\r\n<p>NOTE: Patchwork is a craft of needlework in which small pieces of cloth in different designs, patterns, colors, or textures are sewed together. Each and every patch work is different and unique. The designs may not be identically same.<br>-khut</p>', 'gallery/qNuAqXjLwOnq6gQoT8c8LrUsPo1EZmUoXzPAP7Dh.jpg', 16, 25, NULL, 1260.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'N', 'Read More', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'Y', 'undefined', 'undefined', 'undefined', NULL, '1122162909041', NULL, NULL),
(405, 'pecha', 'Pecha', 'প্যাঁচা', '<p><span style=\"color: #ba372a;\">Gifts &amp; Crafts, Ho-Jo-Bo-Ro-Lo</span><br><span style=\"color: #ba372a;\">হ য ব র ল / Ho-Jo-Bo-Ro-Lo</span></p>\r\n<p>Ho-Jo-Bo-Ro-Lo means &lsquo;Hotchpotch&rsquo;.<br>It&rsquo;s a hotchpotch range of handmade items made of paper, clay, eggshell, plastic, or any scrap material recycled with love towards mother nature. This range is inspired by our village fair (mela), which reminds us of our very own childhood. Bengali color palette is always joyful, and the motif is simple, just like the people of this land.</p>\r\n<p>Together lets create a colorful space with Ho-Jo-Bo-Ro-Lo and inspire<br>recycling | local artisan |<br>handmade goods.</p>', 'gallery/ljOhEXfM9G6WjxQdZx0LVvMOcE5bJyxdZB7NoVUR.jpg', 23, NULL, NULL, 800.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122162928301', NULL, NULL),
(406, 'dim-bou', 'Dim Bou', 'ডিম-বৌ', '<p><span style=\"color: #ba372a;\">Gifts &amp; Crafts, Ho-Jo-Bo-Ro-Lo</span></p>\r\n<p>This beautiful piece of art is made of eggshells, pasted with paper, and then painted with love. Eggshells are very fragile, but a thin layer of paper on them can turn these remnants into a strong canvas. Through layering paper on eggshells, we have realized that a thin layer of love can also make us strong.</p>\r\n<p>Ho-Jo-Bo-Ro-Lo means &lsquo;Hotchpotch&rsquo;.</p>\r\n<p>It&rsquo;s a hotchpotch range of handmade items made of paper, clay, eggshell, plastic, or any scrap material recycled with love towards mother nature. This range is inspired by our village fair (mela), which reminds us of our very own childhood. Bengali color palette is always joyful, and the motif is simple, just like the people of this land.</p>\r\n<p>Together lets create a colorful space with Ho-Jo-Bo-Ro-Lo and inspire<br>recycling | local artisan |<br>handmade goods.</p>', 'gallery/9KSLJE5DjNN6QnOYHnswM4fth0tI8WZ9Hm0rxWhu.jpg', 23, NULL, NULL, 800.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122162928270', NULL, NULL),
(407, 'tepa-putul', 'Tepa Putul', 'টেপা পুতুল', '<p><span style=\"color: #ba372a;\">Gifts &amp; Crafts, Ho-Jo-Bo-Ro-Lo</span><br><span style=\"color: #ba372a;\">হ য ব র ল</span></p>\r\n<p>Ho-Jo-Bo-Ro-Lo means &lsquo;Hotchpotch&rsquo;.</p>\r\n<p>It&rsquo;s a hotchpotch range of handmade items made of paper, clay, eggshell, plastic, or any scrap material recycled with love towards mother nature. This range is inspired by our village fair (mela), which reminds us of our very own childhood. Bengali color palette is always joyful, and the motif is simple, just like the people of this land.</p>\r\n<p>Together lets create a colorful space with Ho-Jo-Bo-Ro-Lo and inspire<br>recycling | local artisan |<br>handmade goods.</p>', 'gallery/f1Y86UeITuLpLeuZMa4kyLEMZRMxkHSA09ZT4Ndv.jpg', 23, NULL, NULL, NULL, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122162928318', NULL, NULL),
(408, 'payraa', 'Payraa', 'পায়রা', '<p><span style=\"color: #ba372a;\">Gifts &amp; Crafts, Ho-Jo-Bo-Ro-Lo</span><br><span style=\"color: #ba372a;\">হ য ব র ল</span></p>\r\n<p>Ho-Jo-Bo-Ro-Lo means &lsquo;Hotchpotch&rsquo;.</p>\r\n<p>It&rsquo;s a hotchpotch range of handmade items made of paper, clay, eggshell, plastic, or any scrap material recycled with love towards mother nature. This range is inspired by our village fair (mela), which reminds us of our very own childhood. Bengali color palette is always joyful, and the motif is simple, just like the people of this land.</p>\r\n<p>Together lets create a colorful space with Ho-Jo-Bo-Ro-Lo and inspire<br>recycling | local artisan |<br>handmade goods.</p>', 'gallery/k6R4P6E9v1hXlbIlTHThbH2S3GA02joKA3WpUzwp.jpg', 23, NULL, NULL, 800.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122390022444', NULL, NULL),
(409, 'bottom-image-home', 'bottom-image-home', 'বটম-ইমেজ', '<p>Khut is an exceptionally unique fashion brand where we cherish Bangladesh&rsquo;s chaotic yet flowing life through our traditional, timeless, hand-made craftsmanship. Each piece in our collection is completely different from the other one as here, in Khut, we believe that uniqueness arises from imperfection which in turn gives every being in the universe their identity. Our greatest inspiration is nature which is forever in motion portrayed in our work. At Khut you are not only purchasing a product, but taking with you a piece of our heart as all of our products are created with immense love which flows from us to you!<a href=\"https://bd.khut.shop/menu/about-khut\">&nbsp;Read More!</a></p>', 'gallery/6gFiytZzxVAF8VNhNXvCI7K0g96Hn9xmvuq97pPv.jpg', 23, NULL, NULL, NULL, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'Y', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'bottom-image', NULL, NULL, NULL, NULL),
