(433, 'benebou', 'Benebou', 'বেনেবৌ', '<p>A handloom cotton saree in a raw turmeric-toned base, featuring delicate blue block prints along a slim border. The achol is adorned with tiny blue floral and finished with soft thread tessels.</p>', 'gallery/3PvMNFYtPAB5ILL1gEoN9G4kv0kcUHwEHwL4jqrj.jpg', 16, 20, 9, 1980.00, NULL, NULL, NULL, 'Standrnd', 'Taxable', '0', 'undefined', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122677821630', NULL, NULL),
(434, 'roudrosnan', 'Roudrosnan', 'রৌদ্রস্নান', '<p>A handloom-woven yellow cotton saree ,Roudrosnan. The border and achol are finished with handstiched over block-prints, evoking the warmth and glow of spring sunlight.</p>', 'gallery/697f3179853d4.jpg', 16, 20, 9, 2310.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '1', 'undefined', 'Add to Cart', '1', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'Y', 'N', 'Feature One', 'undefined', 'undefined', NULL, '1122698546830', NULL, NULL),
(435, 'agnidhoroni', 'Agnidhoroni', 'অগ্নিধরণী', '<div class=\"flex flex-col text-sm pb-25\">\r\n<article class=\"text-token-text-primary w-full focus:outline-none [--shadow-height:45px] has-data-writing-block:pointer-events-none has-data-writing-block:-mt-(--shadow-height) has-data-writing-block:pt-(--shadow-height) [&amp;:has([data-writing-block])&gt;*]:pointer-events-auto [content-visibility:auto] supports-[content-visibility:auto]:[contain-intrinsic-size:auto_100lvh] scroll-mt-[calc(var(--header-height)+min(200px,max(70px,20svh)))]\" dir=\"auto\" tabindex=\"-1\" data-turn-id=\"f775a14f-9ffd-49d8-96ba-b4e7ce89b7c0\" data-testid=\"conversation-turn-2\" data-scroll-anchor=\"true\" data-turn=\"assistant\">\r\n<div class=\"text-base my-auto mx-auto pb-10 [--thread-content-margin:--spacing(4)] @w-sm/main:[--thread-content-margin:--spacing(6)] @w-lg/main:[--thread-content-margin:--spacing(16)] px-(--thread-content-margin)\">\r\n<div class=\"[--thread-content-max-width:40rem] @w-lg/main:[--thread-content-max-width:48rem] mx-auto max-w-(--thread-content-max-width) flex-1 group/turn-messages focus-visible:outline-hidden relative flex w-full min-w-0 flex-col agent-turn\" tabindex=\"-1\">\r\n<div class=\"flex max-w-full flex-col grow\">\r\n<div class=\"min-h-8 text-message relative flex w-full flex-col items-end gap-2 text-start break-words whitespace-normal [.text-message+&amp;]:mt-1\" dir=\"auto\" data-message-author-role=\"assistant\" data-message-id=\"0d4b29ba-eec2-4f00-afb8-fec7d0d64bc8\" data-message-model-slug=\"gpt-5-2\">\r\n<div class=\"flex w-full flex-col gap-1 empty:hidden first:pt-[1px]\">\r\n<div class=\"markdown prose dark:prose-invert w-full wrap-break-word dark markdown-new-styling\">\r\n<p data-start=\"0\" data-end=\"178\" data-is-last-node=\"\" data-is-only-node=\"\">A handloom cotton kota saree in a vibrant shade of orange, Agnidharani comes alive with grace.<br data-start=\"94\" data-end=\"97\">The border and achol are adorned with delicate block prints and fine thread work.</p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"z-0 flex min-h-[46px] justify-start\">&nbsp;</div>\r\n</div>\r\n</div>\r\n</article>\r\n</div>\r\n<div class=\"pointer-events-none h-px w-px absolute bottom-0\" aria-hidden=\"true\" data-edge=\"true\">&nbsp;</div>', 'gallery/QFd4sCKv2DdVGE1Hj3tHpQB1LuUVaa8xe2XMcOLF.jpg', 16, 20, 9, 1980.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '1', 'undefined', 'Add to Cart', '1', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'Y', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122657880855', NULL, NULL),
(436, 'potrobilashi', 'Potrobilashi', 'পত্রবিলসী', '<p>A handloom cotton saree in a light green base introduces &lsquo;Patrobilashi&rsquo;. The border features block prints with delicate thread work, while the deep green achol is adorned with small leaf motifs, highlighted by colourful fabric appliqu&eacute; and fine thread detailing.</p>', 'gallery/aQ1sLlQTOhhSOr6jgmKPHJfXze1OUAGDdhDurYP6.jpg', 16, 20, 9, 2530.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '0', 'undefined', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'Y', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122698555156', NULL, NULL),
(437, 'nirala', 'Nirala', 'নীরালা', '<p>A handloom cotton saree, where the border is adorned with block prints and delicate thread work, while the achol features patchwork enriched with block prints and fine thread detailing.<br><br>Note: Patchwork is a craft of needlework in which small pieces of cloth in different designs, patterns, colors, or textures are sewed together. Each and every patch work is different and unique. The designs may not be identically same.<br class=\"html-br\">If you have any confusion please feel free to ask question/s before confirming your order. We are here to clear any confusion related to our product..<br class=\"html-br\">-khut</p>', 'gallery/dsWl9XOKXMB4dWt2n5NEizYGOV5hBl6oLpWeUYZ4.jpg', 16, 20, 9, 2750.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '1', 'undefined', 'Add to Cart', '1', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'Y', 'undefined', 'undefined', 'undefined', NULL, '1122695068770', NULL, NULL),
(438, 'himkona', 'Himkona', 'হিমকণা', '<p>A half silk saree adorned with block prints, complemented by neat hand-stitched details that add a soft, handcrafted finish.</p>', 'gallery/dD509yyzRFOxvczRf7AJQVtgeGj3t9RHzXNb0FyS.jpg', 16, 20, 11, 2140.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '1', NULL, 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', NULL, NULL, NULL, NULL, '1122677820763', NULL, NULL),
(439, 'pushpochokro', 'Pushpochokro', 'পুষ্পচক্র', '<p>A handloom cotton saree, Pushpochokro graceful block prints and fine thread work come together along the border and the achol, giving it a soft, handcrafted charm.</p>', 'gallery/ndVg6XD2dp6pI7FC7sw342xXZUL0KhrRGFymgIgs.jpg', 16, 20, 9, 2530.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '1', NULL, 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', NULL, NULL, NULL, NULL, '1122638043880', NULL, NULL),
(440, 'chondrollota-3', 'Chondrollota 3', 'চন্দ্রলতা ৩', '<p>A handloom cotton saree with a classic dobi border, finished with a clean and elegant look.</p>', 'gallery/7fC5MDMAYOEf1Y1YE0Ue9orTIScrFum2HVKwn3HK.jpg', 16, 20, 9, 1930.00, NULL, NULL, NULL, 'Cloths', 'Taxable', '0', 'undefined', 'Add to Cart', '0', NULL, NULL, NULL, NULL, 'Y', 'Y', 'N', 'N', 'N', 'undefined', 'undefined', 'undefined', NULL, '1122657985628', NULL, NULL);
