INSERT INTO `site_pages` (`id`, `page_title`, `details`, `image`, `site_menu_id`, `created_at`, `updated_at`) VALUES
(13, 'About Khut', '<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\"><colgroup><col style=\"width: 49.9319%;\"><col style=\"width: 50.0681%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td><img style=\"float: right;\" src=\"data:image/jpeg;base64,\" alt=\"about-body-01.jpg\" width=\"400\" height=\"532\"></td>\r\n<td>\r\n<table style=\"border-collapse: collapse; width: 95.0539%; height: 167.4px; margin-right: 0px; margin-left: auto;\" border=\"1\"><colgroup><col style=\"width: 100%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 167.4px;\">\r\n<td><span style=\"color: #34495e;\"><span class=\"s7\">&nbsp;<span style=\"color: #8f2020;\">Khut</span></span><span class=\"s6\"> is an exceptionally unique fashion brand where we cherish Bangladesh&rsquo;s chaotic&nbsp; yet flowing life through our traditional, timeless, hand-made craftsmanship. Each piece in our collection is completely different from the other one as here, in </span><span class=\"s7\">Khut</span><span class=\"s6\">, we believe that uniqueness arises from imperfection which in turn gives every being in the universe their identity. Our greatest inspiration is nature which is forever in motion portrayed in our work. At&nbsp;</span><span class=\"s7\">Khut</span><span class=\"s6\">&nbsp;you are not only purchasing a product, but taking with you a piece of our heart as all of our products are created with immense love which flows from us to you!</span></span></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p><span style=\"color: #34495e;\">&lsquo;Khut&rsquo; is a bengali word which means defect or imperfection. The core philosophy of <em>Khut</em>&nbsp;lies in embracing the beauty of imperfection. We believe that nothing in nature is flawless and it is within these imperfections that the true essence and identity of every being unfolds. Each flaw contributes to the unique story of the universe, making it all the more phenomenal. Through this philosophy, we discovered a striking resemblance in our creations. Each piece hand-crafted with so much care by our artisan family, carries its own unique imperfections, which in turn, shapes its identity and speaks its story. We have embraced these imperfections, recognizing them as the essence of handmade artistry. It is from this celebration of flaws that our brand was born &mdash; thus, we proudly present&nbsp;<em>Khut</em><span class=\"s2\">.&nbsp;&nbsp;</span></span></p>\r\n<p><span class=\"s2\"><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"about-body-02-2048x1438.jpg\" width=\"570\" height=\"400\"></span></p>\r\n<p>&nbsp;</p>\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">Inspiration</span></h2>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">The inspiration behind&nbsp;<em>Khut</em>&nbsp;is rooted primarily in nature, and this influence is beautifully embodied in our creations in countless ways. Whether it&rsquo;s the striking reflection of the sun&rsquo;s hues on a kaftan or the graceful waves of a river captured in the folds of a saree, nature&rsquo;s presence is deeply woven into everything we create. Its influence is not just a source of inspiration, but a guidance in every design.&nbsp;</span></p>\r\n<p class=\"p2\"><span style=\"color: #34495e;\">Another core inspiration behind&nbsp;<em>Khut</em>&nbsp;is love. Love is the essence of nature, the force through which everything is created and we believe it is the very element that sustains humanity. Love is delicate, fragile and requires nurturing for it to endure &mdash; much like our handcrafted creations at&nbsp;<em>Khut</em>.</span></p>\r\n<p class=\"p2\"><span style=\"color: #34495e;\">Each piece we make is a labor of immense love, infused with care and attention and designed to be cherished. Just as love mirrors the human spirit, our creations embody the philosophy of love, representing its beauty, fragility and timeless significance.</span></p>\r\n<p class=\"p2\">&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\"><colgroup><col style=\"width: 36.6294%;\"><col style=\"width: 63.3706%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td><img src=\"data:image/jpeg;base64,\" alt=\"about-body-03.jpg\" width=\"456\" height=\"342\"></td>\r\n<td>\r\n<div class=\"elementor-element elementor-element-47590c9 elementor-widget elementor-widget-heading\" data-id=\"47590c9\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\">&nbsp;</h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-330ef59 elementor-widget elementor-widget-text-editor\" data-id=\"330ef59\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">The origin of Khut&rsquo;s logo</span></h2>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">The logo of <em>Khut</em>&nbsp;is the creative masterpiece of Shabbashachi Hazra and Rahul Ananda, brought to life in a way that felt almost destined. Its creation was not pre planned but unfolded naturally during a casual conversation among Urmila Shukla, Farhana Hamid, Shabbashachi Hazra, and Rahul Ananda.</span></p>\r\n<p class=\"p2\"><span style=\"color: #34495e;\">While Urmila Shukla and Farhana Hamid were brainstorming and sketching drafts of the logo, Shabbashachi Hazra grew curious and decided to join in. Intrigued and not entirely understanding what they were working on, he asked Urmila, who explained it was&nbsp;<em>Khut&rsquo;s</em>&nbsp;logo. Without hesitation, he snatched the paper and declared, &ldquo;You&rsquo;ll get the logo tomorrow.&rdquo;</span></p>\r\n<p class=\"p2\"><span style=\"color: #34495e;\">What followed was a collaborative effort between Shabbashachi Hazra and Rahul Ananda, who together brought the logo to life. The result is the iconic emblem of&nbsp;<em>Khut</em>, a symbol that captures the brand&rsquo;s essence and philosophy, born from spontaneity, collaboration and creativity.</span></p>\r\n</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"p2\">&nbsp;</p>\r\n<div class=\"elementor-element elementor-element-2cb1f6d elementor-widget elementor-widget-heading\" data-id=\"2cb1f6d\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">Journey</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-773c28b elementor-widget elementor-widget-text-editor\" data-id=\"773c28b\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\"><em>Khut</em>&nbsp;was founded on January 14, 2017, by two close friends, Urmila Shukla and Farhana Hamid Atti. The creation of&nbsp;<em>Khut</em> was never part of their plan, but as if guided by fate, everything gradually fell into place.</span></p>\r\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"data:image/jpeg;base64,\" alt=\"about-body-04-2048x802.jpg\" width=\"1140\" height=\"446\"></p>\r\n<p>&nbsp;</p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">The story of&nbsp;<em>Khut</em>&nbsp;begins with a humble clay doll,&nbsp;<em>tepa putul</em>, a cherished traditional symbol of childhood joy for young girls in Bangladesh. One day, during their free time, Urmila and Farhana found themselves making these delicate clay dolls. On a whim, they decided to name one&nbsp;<em>Shohagi</em>.</span></p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\"><em>Shohagi</em>&nbsp;came to embody the delicate yet profound connection between two lovers&mdash;a relationship that, much like a&nbsp;<em>tepa putul</em>, is fragile and requires care to endure. This symbolism resonated deeply with the philosophy behind&nbsp;<em>Khut</em>, reflecting the beauty, fragility and care inherent in both relationships and handcrafted creations.</span></p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\"><colgroup><col style=\"width: 49.9845%;\"><col style=\"width: 49.9845%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">Before long,&nbsp;<em>Shohagi</em>&nbsp;became a beloved creation among Urmila and Farhana&rsquo;s friends. Its charm and meaning inspired them to transform&nbsp;<em>Shohagi</em>&nbsp;into a pendant. One day, a friend of theirs arrived wearing&nbsp;<em>Shohagi</em>&nbsp;as an accessory paired with a glamorous sharee. However, this moment brought an unexpected realization &mdash; the simplicity and deep philosophy of&nbsp;<em>Shohagi</em>&nbsp;seemed overshadowed by the elaborate clothing.</span></p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">Motivated by this, Urmila and Farhana decided to design a sharee that would perfectly complement the essence of&nbsp;<em>Shohagi</em>. They named it&nbsp;<em>Laal</em>, a creation that embraced simplicity while allowing&nbsp;<em>Shohagi</em>&nbsp;to shine. From this synergy of meaningful design and thoughtful artistry, the journey of&nbsp;<em>Khut</em> began &mdash; a brand born from love, tradition and the celebration of imperfections.</span></p>\r\n</td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://bd-admin.khut.shop/uploads/tinymce/1767788203_695e4eab3c8fa.jpg\" alt=\"\" width=\"446\" height=\"335\"></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\"><em>Khut&nbsp;</em>is more than just a brand; it is a family &mdash; a talented community of artisans, creators and supporters who share a deep appreciation for the beauty of handcrafted art. At its heart,&nbsp;<em>Khut</em>&nbsp;celebrates the collaboration between those who bring our creations to life and those who enjoy them.</span></p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">Our artisans pour their passion, skill and love into every piece, ensuring that each creation tells a unique story. Meanwhile, our supporters are not just patrons &mdash; they are an essential part of the&nbsp;<em>Khut</em>&nbsp;family, embracing our philosophy and carrying forward the legacy of tradition, love and imperfection.</span></p>\r\n<p class=\"p1\"><span style=\"color: #34495e;\">Together, we form a vibrant community bound by a shared vision: to honor heritage, nurture creativity and celebrate the stories that connect us all. At&nbsp;<em>Khut</em>, we don&rsquo;t just create products; we create bonds, memories and a collective journey that brings artisans and supporters together as one family!</span></p>\r\n<p class=\"p1\">&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%;\" border=\"1\"><colgroup><col style=\"width: 50%;\"><col style=\"width: 50%;\"></colgroup>\r\n<tbody>\r\n<tr>\r\n<td>\r\n<p><span style=\"color: #34495e;\">Visit us &mdash; be a part of <em>Khut&nbsp;</em>family.</span></p>\r\n<p><span class=\"cng-fnt\" style=\"color: #8f2020;\">খুঁত</span><br><span style=\"color: #34495e;\">Since January 14, 2017</span><br><span style=\"color: #34495e;\">TRAD/DNCC/072364/2022</span><br><span style=\"color: #34495e;\"><span class=\"elementor-icon-list-text\">01705-020869</span></span><br><a href=\"https://www.facebook.com/khut.art\"><span style=\"color: #3598db;\">khut.art.bangladesh@gmail.com</span></a><br><a href=\"https://www.facebook.com/khut.art\"><span style=\"color: #3598db;\">facebook.com/khut.art</span></a></p>\r\n</td>\r\n<td>\r\n<div class=\"elementor-element elementor-element-43dda72 elementor-widget elementor-widget-heading\" data-id=\"43dda72\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">&nbsp;</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-35a25cb elementor-widget elementor-widget-text-editor\" data-id=\"35a25cb\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><strong><span style=\"color: #8f2020;\"><span class=\"elementor-icon-list-text\">Location</span></span></strong></p>\r\n<p><span style=\"color: #34495e;\"><span class=\"elementor-icon-list-text\"><span style=\"color: #4f2b2b;\"><strong>Lamatia</strong></span><br>House no, 2/9 Block D , Lalmatia-Mohammadpur , Dhaka<br></span><span class=\"elementor-icon-list-text\">Day off: Thursday<br></span><span class=\"elementor-icon-list-text\">01705-020869<br></span><span class=\"elementor-icon-list-text\">khut.art.bangladesh@gmail.com</span></span></p>\r\n<p><span style=\"color: #34495e;\"><span class=\"elementor-icon-list-text\"><span style=\"color: #4f2b2b;\"><strong>Banani</strong></span><br>House no 96, Block E, road 13/C, Banani, Dhaka<br></span><span class=\"elementor-icon-list-text\">Day off: Sunday<br></span><span class=\"elementor-icon-list-text\">01705-020869<br></span><span class=\"elementor-icon-list-text\">khut.art.bangladesh@gmail.com</span></span></p>\r\n</div>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p class=\"p1\">&nbsp;</p>\r\n</div>\r\n</div>', '/uploads/1761816712.jpg', 13, '2025-08-30 02:28:59', '2026-01-12 03:53:29');
