(14, 'Shipping & Delivery Information', '<div class=\"elementor-element elementor-element-6dda689 elementor-widget elementor-widget-heading\" data-id=\"6dda689\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">How can I pay?</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-2e41346 elementor-widget elementor-widget-text-editor\" data-id=\"2e41346\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-element elementor-element-8299375 elementor-widget elementor-widget-text-editor\" data-id=\"8299375\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\"><strong>Inside Dhaka:</strong>&nbsp;We&rsquo;ve got you&nbsp;<span style=\"color: #8f2020;\"><strong>covered with both cash on delivery and prepaid</strong></span>&nbsp;options inside Dhaka, Bangladesh.</span></p>\r\n<p><span style=\"color: #34495e;\"><strong>Outside Dhaka:&nbsp;</strong>Outside Dhaka, Bangladesh we deliver through Courier, and&nbsp;<span style=\"color: #8f2020;\"><strong>cash on delivery is not available</strong></span>&nbsp;for these areas.</span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Inside Dhaka</strong>: Delivery costs&nbsp; <strong>Tk 80</strong>.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Outside Dhaka</strong>: We don&rsquo;t do cash on delivery through<strong>&nbsp;Courier</strong>, the delivery charge is&nbsp;<strong>Tk 150</strong>.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6b37d87 elementor-widget elementor-widget-text-editor\" data-id=\"6b37d87\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\">Your online payment is secured by SSLCOMMERZ Payment Gateway. We accept all reknown payment options.</span></p>\r\n<p>&nbsp;</p>\r\n<table style=\"border-collapse: collapse; width: 100%; height: 103.4px;\" border=\"1\"><colgroup><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"><col style=\"width: 9.9926%;\"></colgroup>\r\n<tbody>\r\n<tr style=\"height: 67.4px;\">\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817227_6903328bd5017.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817270_690332b6d711e.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817773_690334ad3d452.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817799_690334c72c0a3.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817816_690334d857f13.svg\" alt=\"\" width=\"78\" height=\"78\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817845_690334f556b83.svg\" alt=\"\" width=\"78\" height=\"78\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817874_6903351211d77.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817897_69033529aeab2.svg\" alt=\"\" width=\"83\" height=\"83\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818012_6903359c55dff.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761817987_690335837a212.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n</tr>\r\n<tr style=\"height: 36px;\">\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818065_690335d14192e.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818079_690335dfdda48.svg\" alt=\"\" width=\"73\" height=\"73\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818112_6903360043813.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818123_6903360b9882f.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818322_690336d2bc56c.svg\" alt=\"\" width=\"66\" height=\"66\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818214_6903366668b44.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818237_6903367dcc7bb.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818257_690336916df41.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"https://dev.khut.shop/khut-bd-admin/public/uploads/tinymce/1761818269_6903369d95254.svg\" alt=\"\" width=\"80\" height=\"80\"></td>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<p>&nbsp;</p>\r\n<div class=\"elementor-element elementor-element-8515e8d elementor-widget elementor-widget-heading\" data-id=\"8515e8d\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">When will my order arrive?</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-957e253 elementor-widget elementor-widget-text-editor\" data-id=\"957e253\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\"><strong>Delivery Time</strong>:</span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Inside Dhaka</strong>: 3-5 working days.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Outside Dhaka</strong>: 5-7 working days.</span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-f72bf30 elementor-widget elementor-widget-text-editor\" data-id=\"f72bf30\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-element elementor-element-f743da1 elementor-widget elementor-widget-text-editor\" data-id=\"f743da1\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\"><strong>Important</strong>: When you get your delivery, make sure to open it in front of the delivery agent. If anything looks off, let them know right away!</span></p>\r\n<p>&nbsp;</p>\r\n<div class=\"elementor-element elementor-element-b29ac9b elementor-widget elementor-widget-heading\" data-id=\"b29ac9b\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\"><span style=\"color: #8f2020;\">Returns and Issues</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-8666ea1 elementor-widget elementor-widget-text-editor\" data-id=\"8666ea1\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #34495e;\">If you notice something wrong with your order, make sure to tell the delivery agent&nbsp;<strong>right then</strong>.</span></p>\r\n<p><span style=\"color: #34495e;\">If for any reason you don&rsquo;t want to accept the product, you can send it back by paying the delivery charge to the agent.&nbsp;<span style=\"color: #8f2020;\"><strong>Once you&rsquo;ve accepted the product, we can&rsquo;t accept any complaints.</strong></span></span></p>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '/uploads/1761816771.jpg', 15, '2025-08-30 05:19:57', '2025-11-13 04:56:46'),
(15, 'Refund & Returns Policy', '<div class=\"elementor-element elementor-element-e32cdb8 elementor-widget elementor-widget-heading\" data-id=\"e32cdb8\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\" style=\"text-align: left;\"><span style=\"color: #8f2020;\">Return policy</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-46bc7fb elementor-widget elementor-widget-text-editor\" data-id=\"46bc7fb\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #8f2020;\"><strong>Inside Dhaka:</strong></span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Please check your product in front of the delivery agent.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">If you notice any issues, let the agent know immediately.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">If you don&rsquo;t want the product, you can return it on the spot by paying the delivery charge.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Once you accept the product, we will not accept any complaints, returns, or refunds.</span></li>\r\n</ul>\r\n<p><span style=\"color: #34495e;\"><em>Cash on Delivery orders cannot be returned or refunded after acceptance.</em></span></p>\r\n<p><span style=\"color: #8f2020;\"><strong>Outside Dhaka:</strong></span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Check your product as soon as you receive it from the courier.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">If you are not satisfied, contact us immediately via our helpline (<strong>01705020869</strong>) or inbox us on Facebook:&nbsp;<a style=\"color: #34495e;\" href=\"https://www.facebook.com/khut.art\">facebook.com/khut.art</a></span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You must return the product within&nbsp;<span style=\"color: #8f2020;\"><strong>3&ndash;5 days</strong>.</span></span></li>\r\n</ul>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6d3bf18 elementor-widget-divider--view-line elementor-widget elementor-widget-divider\" data-id=\"6d3bf18\" data-element_type=\"widget\" data-widget_type=\"divider.default\">\r\n<div class=\"elementor-widget-container\">\r\n<div class=\"elementor-divider\">&nbsp;</div>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-6156336 elementor-widget elementor-widget-heading\" data-id=\"6156336\" data-element_type=\"widget\" data-widget_type=\"heading.default\">\r\n<div class=\"elementor-widget-container\">\r\n<h2 class=\"elementor-heading-title elementor-size-default\" style=\"text-align: left;\"><span style=\"color: #8f2020;\">Refund policy</span></h2>\r\n</div>\r\n</div>\r\n<div class=\"elementor-element elementor-element-1fe3a69 elementor-widget elementor-widget-text-editor\" data-id=\"1fe3a69\" data-element_type=\"widget\" data-widget_type=\"text-editor.default\">\r\n<div class=\"elementor-widget-container\">\r\n<p><span style=\"color: #8f2020;\"><strong>Cash on Delivery:</strong>&nbsp;</span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Check the product in front of the delivery agent. If you don&rsquo;t want it,&nbsp;<span style=\"color: #8f2020;\"><strong>only pay the delivery charge</strong></span>&nbsp;and return the product.</span></li>\r\n</ul>\r\n<p><span style=\"color: #34495e;\"><em>Cash on Delivery orders cannot be returned or refunded after acceptance.</em></span></p>\r\n<p><span style=\"color: #8f2020;\"><strong>Online Payment (bKash/Nagad/Bank Transfer):</strong></span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Notify us with proof of the return on our Facebook page:&nbsp;<span style=\"color: #236fa1;\"><a style=\"color: #236fa1;\" href=\"https://www.facebook.com/khut.art\">facebook.com/khut.art</a></span></span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Refunds will be processed within&nbsp;<span style=\"color: #8f2020;\"><strong>7-10</strong><strong>&nbsp;working days</strong></span></span></li>\r\n</ul>\r\n</div>\r\n</div>', '/uploads/1761816818.jpg', 16, '2025-08-30 05:33:09', '2025-11-13 04:55:19'),
(16, 'Privacy Policy', '<p><span style=\"color: #8f2020;\"><strong>Welcome to Khut!</strong></span><br><span style=\"color: #34495e;\">At Khut, we value your privacy and are committed to protecting your personal information. This Privacy Policy explains how we collect, use, disclose, and safeguard your information when you visit our website [<a style=\"color: #34495e;\" href=\"https://khut.shop/bd/\">khut.shop/bd</a>]. By using our Website, you agree to the practices described in this policy.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #4f2b2b;\"><strong><span style=\"color: #8f2020;\">Information We&nbsp;Collect</span></strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We may collect various types of personal data, including but not limited to:</span></p>\r\n<ul data-spread=\"false\">\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Personal Information:</strong>&nbsp;Name, email address, phone number, billing and shipping address.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Payment Information:</strong>&nbsp;Prefered payment methods.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Account Information:</strong>&nbsp;Username, purchase history, and preferences.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Technical Information:</strong>&nbsp;IP address, browser type, device information, operating system, and cookies.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Usage Information:</strong>&nbsp;Pages visited, time spent on the website, links clicked, and interaction data.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Communication Information:</strong>&nbsp;Customer support inquiries, reviews, and feedback.</span></p>\r\n</li>\r\n</ul>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>How We Use Your Information</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We use the collected information to:</span></p>\r\n<ul data-spread=\"false\">\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Process and fulfill your orders.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Improve our Website, products, and services.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Provide customer support and respond to inquiries.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Send promotional emails, offers, and updates (you can opt out anytime).</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Prevent fraud, ensure security, and comply with legal obligations.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Personalize your shopping experience and recommend products.</span></p>\r\n</li>\r\n</ul>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>How We Share Your Information</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We do not sell or rent your personal data. However, we may share your information with:</span></p>\r\n<ul data-spread=\"false\">\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Service Providers:</strong>&nbsp;Payment processors, shipping companies, and marketing platforms to facilitate transactions.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Legal Authorities:</strong>&nbsp;When required by law, regulation, or to protect our rights.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Business Transfers:</strong>&nbsp;In case of a merger, acquisition, or sale of assets, your data may be transferred.</span></p>\r\n</li>\r\n</ul>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Cookies and Tracking Technologies</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We use cookies, web beacons, and similar tracking technologies to enhance your browsing experience. You can manage cookie preferences through your browser settings.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Data Security</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We implement appropriate security measures to protect your personal data from unauthorized access, alteration, or disclosure. However, no online transmission is 100% secure, and we encourage you to take precautions.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Your Rights and Choices</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">Depending on your location, you may have the following rights:</span></p>\r\n<ul data-spread=\"false\">\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Access, correct, or delete your personal information.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Opt out of marketing communications.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Restrict or object to certain data processing activities.</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\">Request data portability.</span></p>\r\n</li>\r\n</ul>\r\n<p><span style=\"color: #34495e;\">To exercise your rights, please contact us at&nbsp;<a style=\"color: #34495e;\" href=\"mailto:khut.help@gmail.com\">khut.help@gmail.com</a>.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Third-Party Link</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">Our Website may contain links to third-party websites. We are not responsible for their privacy practices, so we encourage you to read their policies before sharing information.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Children&rsquo;s Privacy</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">Our Website is not intended for children under the age of 13. We do not knowingly collect personal data from minors.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Changes to This Privacy Policy</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">We may update this policy from time to time. Any changes will be posted on this page with the updated date.</span></p>\r\n<div><hr></div>\r\n<h3><span style=\"color: #8f2020;\"><strong>Contact Us</strong></span></h3>\r\n<p><span style=\"color: #34495e;\">If you have any questions about this Privacy Policy, please contact us at:</span></p>\r\n<ul data-spread=\"false\">\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Email:</strong>&nbsp;<a style=\"color: #34495e;\" href=\"mailto:khut.help@gmail.com\">khut.help@gmail.com</a></span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Address:</strong>&nbsp;House No. 2/9, Block D, Lalmatia-Mohammadpur, Dhaka, Bangladesh 1207</span></p>\r\n</li>\r\n<li style=\"color: #34495e;\">\r\n<p><span style=\"color: #34495e;\"><strong>Phone:&nbsp;</strong><a style=\"color: #34495e;\" href=\"tel:+8801705020869\">+880 1705-020869</a></span></p>\r\n</li>\r\n</ul>\r\n<p><span style=\"color: #34495e;\">Thank you for trusting Khut!</span></p>', '/uploads/1761816851.jpg', 17, '2025-08-30 05:37:01', '2025-11-13 04:52:51'),
(17, 'Terms & Conditions', '<p><span style=\"color: #7b1d1d;\"><strong>Welcome to Khut!</strong></span><br><span style=\"color: #34495e;\">These Terms &amp; Conditions govern your use of our website <span style=\"color: #236fa1;\">[<a style=\"color: #236fa1;\" href=\"https://khut.shop/bd/\">khut.shop/bd</a>]</span>. By accessing or using our Website, you agree to comply with and be bound by these terms. If you do not agree, please do not use our Website.</span></p>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Account &amp; User Responsibilities</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You must be at least 18 years old or have parental consent to use our Website.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You are responsible for maintaining the confidentiality of your account credentials.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You agree to provide accurate and current information when creating an account.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We reserve the right to suspend or terminate accounts suspected of fraudulent activity.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Orders &amp; Payment</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">All orders placed on Khut are subject to acceptance and availability.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We reserve the right to cancel or refuse any order at our discretion.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Prices are displayed in BDT (৳) and may be subject to change without prior notice.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Payments must be completed using our accepted payment methods.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">If a payment is declined, the order may be delayed or cancelled.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Shipping &amp; Delivery</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Estimated delivery times are provided at checkout but are not guaranteed.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Khut is not responsible for delays due to external factors (e.g., weather, customs, carrier issues).</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Risk of loss transfers to the customer upon shipment.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Customers must provide accurate shipping details; Khut is not responsible for incorrect addresses.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Returns &amp; Refunds</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Customers may return products within 3 days of receipt, subject to our Return Policy.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Items must be in original condition with all packaging and tags attached.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We reserve the right to reject returns that do not meet our policy requirements.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Product Descriptions &amp; Availability</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We strive to provide accurate product descriptions and images but do not guarantee complete accuracy.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Products may be discontinued or out of stock at any time without notice.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Colors and sizes may vary slightly due to screen settings and manufacturing differences.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Use of the Website</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You agree not to use our Website for any unlawful or prohibited activities.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Unauthorized access, hacking, or data extraction from our Website is strictly prohibited.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We may monitor and restrict access to users who violate these terms.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Intellectual Property</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">All content on our Website, including text, images, logos, and trademarks, is the property of Khut.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">You may not reproduce, distribute, or use any content without our express written permission.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Limitation of Liability</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Khut is not liable for any indirect, incidental, or consequential damages arising from the use of our Website or products.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We do not guarantee uninterrupted or error-free Website access.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Our total liability for any claim is limited to the amount paid for the product in question.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Changes to Terms &amp; Conditions</strong></span></h4>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">We reserve the right to update these terms at any time without prior notice.</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\">Continued use of our Website constitutes acceptance of any modifications.</span></li>\r\n</ul>\r\n<hr>\r\n<h4><span style=\"color: #7b1d1d;\"><strong>Contact Us</strong></span></h4>\r\n<p><span style=\"color: #34495e;\">If you have any questions about these Terms &amp; Conditions, please contact us at:</span></p>\r\n<ul>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Email:</strong>&nbsp;<a style=\"color: #34495e;\" href=\"mailto:khut.help@gmail.com\">khut.help@gmail.com</a></span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Address:</strong>&nbsp;House No. 2/9, Block D, Lalmatia-Mohammadpur, Dhaka, Bangladesh 1207</span></li>\r\n<li style=\"color: #34495e;\"><span style=\"color: #34495e;\"><strong>Phone:&nbsp;</strong>+880 1705-020869</span></li>\r\n</ul>\r\n<p><span style=\"color: #34495e;\">Thank you for choosing Khut!</span></p>', '/uploads/1761816914.jpg', 18, '2025-08-30 05:38:58', '2025-11-13 05:05:30'),
